import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import styles from '../styles/RegisterComponent.module.css';

export default function RegisterComponent() {
  const [component, setComponent] = useState('');
  const [serialNumber, setSerialNumber] = useState('');
  const [purpose, setPurpose] = useState('');
  const [typeCombination, setTypeCombination] = useState('');
  const [flavor, setFlavor] = useState('');
  const [vendor, setVendor] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    // Add logic to handle form submission
    console.log({ component, serialNumber, purpose, typeCombination, flavor, vendor });
  };

  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <Link to="/home" className={styles.backLink}>
          ← Back to Home
        </Link>
        <h1 className={styles.title}>Register Component</h1>
      </header>

      <div className={styles.content}>
        <form onSubmit={handleSubmit} className={styles.form}>
          <div className={styles.field}>
            <label htmlFor="component">Component Type:</label>
            <input
              id="component"
              type="text"
              value={component}
              onChange={(e) => setComponent(e.target.value)}
              required
            />
          </div>

          <div className={styles.field}>
            <label htmlFor="serialNumber">Serial Number:</label>
            <input
              id="serialNumber"
              type="text"
              value={serialNumber}
              onChange={(e) => setSerialNumber(e.target.value)}
              required
            />
          </div>

          <div className={styles.field}>
            <label htmlFor="purpose">Purpose:</label>
            <input
              id="purpose"
              type="text"
              value={purpose}
              onChange={(e) => setPurpose(e.target.value)}
              required
            />
          </div>

          <div className={styles.field}>
            <label htmlFor="typeCombination">Type Combination:</label>
            <input
              id="typeCombination"
              type="text"
              value={typeCombination}
              onChange={(e) => setTypeCombination(e.target.value)}
              required
            />
          </div>

          <div className={styles.field}>
            <label htmlFor="flavor">Flavor:</label>
            <input
              id="flavor"
              type="text"
              value={flavor}
              onChange={(e) => setFlavor(e.target.value)}
              required
            />
          </div>

          <div className={styles.field}>
            <label htmlFor="vendor">Vendor:</label>
            <input
              id="vendor"
              type="text"
              value={vendor}
              onChange={(e) => setVendor(e.target.value)}
              required
            />
          </div>

          <button type="submit" className={styles.submitBtn}>Submit</button>
        </form>
      </div>

      <footer className={styles.footer}>
        <p>© 2024 Your Company</p>
      </footer>
    </div>
  );
}
